def london_city_hacker(journey):
    cost = 0
    tube_cost = 0
    bus_cost = 0
    bus_count = 0
    for item in journey:
        if isinstance(item, str):
            tube_cost += 2.40
        else:
            bus_cost += 1.50
            bus_count += 1
            if bus_count >= 2:
                bus_cost -= 1.50
                bus_count = 0
    cost = tube_cost + bus_cost
    return "£{:.2f}".format(cost)
